const RM = 'https://rickandmortyapi.com/api'
// set this by env
const API_BASE = 'http://localhost:3000/api'

const API = {
  R_M: {
    characters: `${RM}/character/`
  },
  BASE: {
    characters: `${API_BASE}/character`
  }
};

export default API;
